import React from "react";



const Item = props => {
    const { product } = props;

    return (<div>
        <div>{product.name}</div>
        <div>${product.price}</div>
        <div>{product.description}</div>
        <button
            onClick={() =>
                props.addToCart({
                    id: product.name,
                    product,
                    amount: 1
                })
            }
        >
            Add to Cart
              </button>

    </div>)
}

export default Item;
